INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('7ba915f4-80c0-42cc-8a13-4a5e7391b1de', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"다음 중 보호구의 구비요건에 해당하지 않는 것은?"', '"착용하여 작업하기 쉬울 것;유해위험물로부터 보호성능이 충분할 것;사용재료가 작업자에게 해로운 영향을 주지 않을 것;중량이 클수록 충격흡수가 좋아 무거울 것"', '3', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('5be21cd6-f67d-48ed-9216-3b53c17b3f9b', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"물체의 낙하 또는 비래와 더불어 추락에 의한 위험을 방지 또는 경감하기 위해 사용하는 안전모의 종류는 무엇인가?"', '"낙하방지용 A형;낙하 및 추락방지용 AB형;낙하 및 감전방지용 AE형;다목적용 ABE형"', '1', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('ff9c5c01-bdd2-462e-bdbb-742650e4c47f', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"플라스틱 등 합성수지 안전모의 관리방법으로 옳지 않은 것은?"', '"자외선 등에 의해 탄성이 감소하거나 색상변화 균열이 발생하면 교체한다;자동차 뒷창문 등 직사광선이 강한 곳에 보관하지 않는다;합성수지 안전모는 스팀이나 뜨거운 물 사용을 피한다;강한 세척을 위해 고온 스팀으로 자주 소독한다"', '3', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('ffc18db4-d170-4a53-bbcd-06b41ac980c5', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"가죽제 안전화의 기능으로 알맞은 것은?"', '"물체의 낙하충격과 날카로운 것에 의한 찔림을 방지한다;방수성과 내화학성이 우수하여 화학약품 작업에만 사용한다;정전기의 인체대전을 방지한다;감전에 의한 위험만을 방지한다"', '0', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('546a8d07-d3da-4a0f-aabd-17d1c4fb0c78', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"광산 채광 작업이나 건설현장의 중량물 운반작업 등에 적합한 안전화 작업등급은 무엇인가?"', '"경작업용;보통작업용;중작업용;특수작업용"', '2', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('cc694480-b55d-4559-bb5c-adadcc7a9386', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"차광보안경이 갖추어야 할 기능으로 옳지 않은 것은?"', '"유해한 자외선을 차단한다;강렬한 가시광선을 약하게 하여 광원의 상태를 관측할 수 있게 한다;열작업에서 발생하는 적외선을 차단한다;작업장의 소음을 감소시켜 청력을 보호한다"', '3', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('6819219f-de6f-4916-9363-98108d76997a', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"다음 중 소음 정도에 따른 귀 보호구 선택 기준으로 옳은 것은?"', '"소음이 70에서 80데시벨일 때 귀마개와 귀덮개를 동시에 착용한다;소음이 85에서 115데시벨일 때 귀마개 또는 귀덮개를 착용한다;소음이 110에서 120데시벨 이상이어도 귀덮개만 착용하면 된다;소음 정도와 관계없이 항상 귀마개와 귀덮개를 동시에 착용한다"', '1', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('09ada9b8-6f79-47d5-b862-01e5babb4f24', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"다음 중 귀마개와 귀덮개 선택에 대한 설명으로 가장 옳은 것은?"', '"활동이 많은 작업에는 귀덮개를 우선 사용한다;활동이 적은 작업에는 귀마개를 사용해야 한다;중이염 등 귀에 이상이 있을 때는 귀마개를 깊게 밀어 넣는다;활동이 많은 작업에는 귀마개를 활동이 적은 작업에는 귀덮개를 사용하는 것이 바람직하다"', '3', 'medium');
INSERT INTO "Assessment" ("id", ""courseId"", "question", "options", ""correctAnswer"", "difficulty") VALUES ('b3d6b6d5-3a86-4ec2-a51d-440529396db0', 'fbb714d8-3d40-4370-8042-d7070916f97c', '"방진마스크의 사용 및 관리요령으로 볼 때 옳지 않은 것은?"', '"사용 전에 배기밸브와 흡기밸브의 기능 및 공기누설 여부를 점검한다;여과재는 건조한 상태에서 사용한다;필터에 쌓인 분진은 수시로 제거하여 사용한다;여과 효율을 높이기 위해 여과재를 물에 충분히 적신 후 착용한다"', '3', 'medium');
