INSERT INTO "SimpleEmailConfigs" ("id", ""emailType"", "subject", "content", "enabled", ""sendTiming"", ""daysAfter"", ""scheduledTime"", ""monthlyDay"", ""createdAt"", ""updatedAt"") VALUES ('bbb046a6-99de-4426-9d30-49747c1ed02a', 'EXEC_SIGNATURE_REQUEST', '월간 TBM 보고서 임원 서명 요청', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;">\n  <h2 style="color: #2563eb;">월간 TBM 보고서 임원 서명 요청</h2>\n  <p>안녕하세요.</p>\n  <p>{{MONTH}}월 TBM 보고서에 대한 임원 서명이 필요합니다.</p>\n  <p><strong>보고서:</strong> {{REPORT_NAME}}</p>\n  <p><strong>작성팀:</strong> {{TEAM_NAME}}</p>\n  <p><strong>작성일:</strong> {{CREATED_DATE}}</p>\n  <p>아래 링크를 클릭하여 보고서를 확인하고 서명해주세요.</p>\n  <p><a href="{{REPORT_URL}}" style="background-color: #2563eb; color: white; padding: 10px 20px; text-decoration: none; border-radius: 5px; display: inline-block;">보고서 확인 및 서명</a></p>\n  <p>감사합니다.</p>\n</div>', 't', 'IMMEDIATE', '\N', '\N', '\N', '2025-11-24 01:11:24.333', '2025-11-24 01:11:24.333');
INSERT INTO "SimpleEmailConfigs" ("id", ""emailType"", "subject", "content", "enabled", ""sendTiming"", ""daysAfter"", ""scheduledTime"", ""monthlyDay"", ""createdAt"", ""updatedAt"") VALUES ('1c9abab0-4ac7-474e-a18f-3c6387e54aa4', 'EXEC_SIGNATURE_COMPLETE', '월간 TBM 보고서 임원 서명 완료', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;">\n  <h2 style="color: #10b981;">월간 TBM 보고서 임원 서명 완료</h2>\n  <p>안녕하세요.</p>\n  <p>{{MONTH}}월 TBM 보고서에 임원 서명이 완료되었습니다.</p>\n  <p><strong>보고서:</strong> {{REPORT_NAME}}</p>\n  <p><strong>서명자:</strong> {{SIGNER_NAME}} ({{SIGNER_ROLE}})</p>\n  <p><strong>서명일시:</strong> {{SIGNED_DATE}}</p>\n  <p>아래 링크를 클릭하여 최종 보고서를 확인하세요.</p>\n  <p><a href="{{REPORT_URL}}" style="background-color: #10b981; color: white; padding: 10px 20px; text-decoration: none; border-radius: 5px; display: inline-block;">최종 보고서 확인</a></p>\n  <p>감사합니다.</p>\n</div>', 't', 'IMMEDIATE', '\N', '\N', '\N', '2025-11-24 01:11:24.337', '2025-11-24 01:11:24.337');
INSERT INTO "SimpleEmailConfigs" ("id", ""emailType"", "subject", "content", "enabled", ""sendTiming"", ""daysAfter"", ""scheduledTime"", ""monthlyDay"", ""createdAt"", ""updatedAt"") VALUES ('bb3326d5-b203-42f6-9668-3f448896a0d0', 'TBM_REMINDER', 'TBM 일지 미작성 알림', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;">\n  <h2 style="color: #f59e0b;">TBM 일지 미작성 알림</h2>\n  <p>안녕하세요, {{USER_NAME}}님.</p>\n  <p>{{DATE}} TBM 일지가 아직 작성되지 않았습니다.</p>\n  <p><strong>팀:</strong> {{TEAM_NAME}}</p>\n  <p><strong>미작성 일수:</strong> {{DAYS_OVERDUE}}일</p>\n  <p>빠른 시일 내에 TBM 일지를 작성해주시기 바랍니다.</p>\n  <p><a href="{{TBM_URL}}" style="background-color: #f59e0b; color: white; padding: 10px 20px; text-decoration: none; border-radius: 5px; display: inline-block;">TBM 일지 작성하기</a></p>\n  <p>감사합니다.</p>\n</div>', 't', 'AFTER_N_DAYS', '3', '\N', '\N', '2025-11-24 01:11:24.339', '2025-11-24 01:11:24.339');
INSERT INTO "SimpleEmailConfigs" ("id", ""emailType"", "subject", "content", "enabled", ""sendTiming"", ""daysAfter"", ""scheduledTime"", ""monthlyDay"", ""createdAt"", ""updatedAt"") VALUES ('4d463f69-5834-4488-acb6-88842d783762', 'EDUCATION_REMINDER', '안전교육 미수강 알림', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;">\n  <h2 style="color: #f59e0b;">안전교육 미수강 알림</h2>\n  <p>안녕하세요, {{USER_NAME}}님.</p>\n  <p>필수 안전교육이 아직 완료되지 않았습니다.</p>\n  <p><strong>교육명:</strong> {{COURSE_NAME}}</p>\n  <p><strong>마감일:</strong> {{DUE_DATE}}</p>\n  <p><strong>진행률:</strong> {{PROGRESS}}%</p>\n  <p>마감일까지 안전교육을 완료해주시기 바랍니다.</p>\n  <p><a href="{{COURSE_URL}}" style="background-color: #f59e0b; color: white; padding: 10px 20px; text-decoration: none; border-radius: 5px; display: inline-block;">교육 이어보기</a></p>\n  <p>감사합니다.</p>\n</div>', 't', 'AFTER_N_DAYS', '7', '\N', '\N', '2025-11-24 01:11:24.341', '2025-11-24 01:11:24.341');
INSERT INTO "SimpleEmailConfigs" ("id", ""emailType"", "subject", "content", "enabled", ""sendTiming"", ""daysAfter"", ""scheduledTime"", ""monthlyDay"", ""createdAt"", ""updatedAt"") VALUES ('b59512ee-cb18-4692-8253-7da27a37a5a6', 'INSPECTION_REMINDER', '안전점검 미작성 알림 (매월 4일)', '<div style="font-family: Arial, sans-serif; max-width: 600px; margin: 0 auto;">\n  <h2 style="color: #f59e0b;">안전점검 미작성 알림</h2>\n  <p>안녕하세요, {{USER_NAME}}님.</p>\n  <p>{{MONTH}}월 안전점검이 아직 작성되지 않았습니다.</p>\n  <p><strong>담당팀:</strong> {{TEAM_NAME}}</p>\n  <p><strong>마감일:</strong> 매월 4일</p>\n  <p>매월 4일까지 안전점검을 완료해주시기 바랍니다.</p>\n  <p><a href="{{INSPECTION_URL}}" style="background-color: #f59e0b; color: white; padding: 10px 20px; text-decoration: none; border-radius: 5px; display: inline-block;">안전점검 작성하기</a></p>\n  <p>감사합니다.</p>\n</div>', 't', 'MONTHLY_DAY', '\N', '\N', '4', '2025-11-24 01:11:24.344', '2025-11-24 01:11:24.344');
